import React from 'react'
import { AppBar, Box, Button, Container, styled, Toolbar, Typography } from "@mui/material"
import MenuIcon from "@mui/icons-material/Menu"
import Logo from '../IMGs/Greenweels.png';
import LoginIcon from "@mui/icons-material/Login"

export const Navigation = () => {
    
    const LinkItem = styled(Typography) (({theme}) => ({
        fontSize: "17px",
        color: "#000",
        fontWeight: "bold",
        cursor: "pointer",
        "&:hover":{
            color: "#4CAF50"
            //color: "#1B5E20"
        }
    }));

    const LinkItemsBox = styled(Box) (({theme}) => ({
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        gap: theme.spacing(3),
        [theme.breakpoints.down("md")]: {
            display: "none"
        }
    }));

    const NavIcon = styled(MenuIcon) (({theme}) => ({
        display: "none",
        cursor: "pointer",
        marginRight: theme.spacing(2),
        [theme.breakpoints.down("md")]: {
            display: "block"
        }
    }));

    const NavContainer = styled(Container) (({theme}) => ({
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
        padding: theme.spacing(3),
        [theme.breakpoints.down("md")]: {
            padding: theme.spacing(2)
        }
    }));

    const NavBar = styled(AppBar) (({theme}) => ({
        display: "flex",
        alignItems: "center",
        height: "100px",
        backgroundColor: "#0000",
        justifyContent: "space-between",
        boxShadow: "1px 2px 9px #0006",
        [theme.breakpoints.down("md")]: {
            display: "none"
        }
    }));

    const NavLogo = styled("img") (({theme}) => ({
        cursor: "pointer",
        width: "140px",
        [theme.breakpoints.down("md")]: {
            display: "none"
        }
    }));

    return (
        <NavBar>
            <NavContainer>
            <Box sx={{display:"flex", alignItems:"center", justifyContent: "center", gap: "40px"}}>
                <Box sx={{display:"flex", alignItems:"center"}}>
                    <NavIcon />
                    <NavLogo src={Logo} alt="logo"/>
                </Box>
                <LinkItemsBox>
                    <LinkItem variant="body2">Start</LinkItem>
                    <LinkItem variant="body2">So funktioniert's</LinkItem>
                    <LinkItem variant="body2">Preise</LinkItem>
                    <LinkItem variant="body2">HÃ¤ufige Fragen</LinkItem>
                </LinkItemsBox>
            </Box>
            <Box sx={{display:"flex", alignItems:"center", justifyContent: "center", gap: "30px"}}>
                <LinkItem variant="body2">LogIn</LinkItem>
                <Button variant="contained" color= "success" startIcon={<LoginIcon />}>Register</Button>
            </Box>
        </NavContainer>
        </NavBar>   
    );
}

export default Navigation;
